import { Table } from "react-bootstrap";
import data from "./events_data";
import events from '../App';

const MyEvents = () => {
  const myEvents = events[0].filter((eve) => eve.registered === true);
  return (
    <Table striped bordered hover>
      <thead>
        <tr>
          <th>#</th>
          <th>Event Name</th>
          <th>Organiser</th>
          <th>Date</th>
          <th>Location</th>
        </tr>
      </thead>

      <tbody>
        {myEvents.map((eve) => (
          <tr key={eve.id}>
            <td>{eve.id}</td>
            <td>{eve.text}</td>
            <td>{eve.organiser}</td>
            <td>{eve.date}</td>
            <td>{eve.location}</td>
          </tr>
        ))}
      </tbody>
    </Table>
  );
};

export default MyEvents;
